body {
    text-align:center;
    font-family:Verdana, Arial, Helvetica, sans-serif;
    font-size:.7em;
    padding:10px;
    margin:0px;
    color:#999999 !important;
    background:#181818 !important;
    line-height:1.3em;
}

#main-content {
 margin-bottom: 10px !important; 
}

/* Search Results */

#torrents {
    background: #333 !important;
}

#browse h1, #description_container .text-box {
    background: #181818 !important;
    border: none !important;
    border-bottom: 1px solid #444 !important;
}

#torrents span.list-header, #torrents li.list-entry {
    background: #333 !important;
    border: none !important;
    border-bottom: 1px solid #444 !important;
}

#description_container, #description_container #filelist li.alt {
    background: #181818 !important;
}

a {
    color:#cccccc !important;
    text-decoration:none;
    border-bottom: 0px !important; 
    text-shadow:none !important;
    transition:text-shadow 1s, color 1s !important;
}

a:hover {
    color:#eee !important;
    text-decoration:none !important;
    text-shadow:0 0 5px #fff !important;
    transition:text-shadow 1s, color 1s !important; 
}

#TPBlogo {
    float:left;
    border:0;
    padding:0;
    margin-top: -7px !important; 
    padding-right:10px;
    margin-bottom: 3px !important; 
    transform: scale(.9) !important; 
    transition: transform .4s;
}
                       
#fp h1 a {
    transform: scale(.9) !important; 
    transition: transform .4s !important;
}

#TPBlogo:hover, #fp h1 a:hover {
   transform: scale(1) !important; 
   transition: transform .4s !important;
}

#breadcrumbs {
    text-align:left;
    vertical-align:bottom;
    font-size:0.8em;
    font-family:Tahoma, Arial, Verdana, sans-serif;
    font-weight:bold;
    padding:0 0 0 5px;
    margin:0;
    clear:both;
}

h2 {
    font-size:1.1em;
    line-height:1.5em;
    text-align:right;
    padding:2px 5px;
    margin:0;
    border-bottom: 0px solid #333333 !important;
    background: #282828 !important;
    font-weight:normal;
    color:#aaa !important;
    clear:both;
    border-radius: 5px !important;
}

h2 span {
    font-weight:bold;
    float:left;
    font-size:1.1em;
}

.header a {
    color:#cccccc !important;
}

p, #description_container dt {
   color: #999999 !important; 
}

.searchBox, input, select, header form select {
 background-color: #333333 !important; 
 color: #aaa !important; 
 border: 1px solid #444444 !important; 
 border-radius: 4px !important; 
    padding: 4px 6px;
}

input {
    transition: all 0.4s;
}

input:focus {
    outline: none !important;
    box-shadow: 0 0 3px rgba(255, 255, 255, 0.9);
}

#home input {
    filter: grayscale(1);
}

/* Search */

#inp > input:nth-child(1), .inputbox  {
 -moz-appearance: none !important; 
 background: linear-gradient(to top, #333, #181818) !important; 
 color: #aaa !important; 
 border: 1px solid #555 !important; 
 border-radius: 5px !important; 
 box-shadow: 0 0 10px transparent !important; 
 transition: box-shadow 1s !important; 
}

#inp > input:nth-child(1):focus, .inputbox:focus {
 box-shadow: 0 0 10px #666666 !important; 
 transition: box-shadow 1s !important; 
    outline: none !important;
    filter: grayscale(1);
}

/* Button */

.submitbutton, #category, #subm > input {
 -moz-appearance: none !important; 
 background: linear-gradient(#444444, #282828) !important; 
 border: 1px solid #555 !important; 
 color: #aaa !important; 
 border-radius: 5px !important; 
 box-shadow: 0 0 10px transparent !important; 
 transition: box-shadow 1s !important; 
}

.submitbutton:hover, #category:hover, #subm > input:hover {
 -moz-appearance: none !important; 
